window.bookSummaryJSON = "<p>Out of all the mysterious boarders who call Sanctuary home, no one is more antisocial or withdrawn than Maxis Drago. But then, it's hard to blend in with the modern world when you have a fifty-foot wingspan. <br> <br> Centuries ago, he was cursed by an enemy who swore to see him fall. An enemy who took everything from him and left him forever secluded.<br> <br> But Fate is a bitch, with a wicked sense of humor. And when she throws old enemies together and threatens the wife he thought had died centuries ago, he comes back with a vengeance. Modern-day New Orleans has become a battleground for the oldest of evils. And two dragons will hold the line, or go down in flames, in <i>Dragonbane,</i>the next explosive <i>Dark-Hunter </i>novel from #1 <i>New York Times </i>bestselling author Sherrilyn Kenyon.</p>"; 
